import React, {useState, useEffect} from "react";
import Axios from "axios";
import LookupResult from "./LookupResult";
import Footer from "./Footer";
import { Link, Switch, Route, useHistory, useLocation } from 'react-router-dom';
import ArrowBackIcon from '@material-ui/icons/ArrowBack';

function Profile(props) {
    const history = useHistory();
    const location = useLocation()
    const [isMouseOver, setMouseOver] = useState(false);

    const [licensePlate, setLicensePlate] = useState("");
    const [customerName, setCustomerName] = useState("");
    const [emailAddress, setEmailAddress] = useState("");

    function handleMouseOver() {
        setMouseOver(true);
    }

    function handleMouseOut() {
        setMouseOver(false);
    }

    return (
    <div className="page-container">
        <h1 className="page-header">Customer Profile</h1>
        <label className="lookup-label">License Plate Number</label>
            <p>{location.state.license}</p>
        <label className="lookup-label">Customer's Full Name</label>
            <p>{location.state.name}</p>
        <label className="lookup-label">Email Address</label>
            <p>{location.state.email}</p>
            <button
                className="lookup-input search"
                style={{backgroundColor: isMouseOver ? "black" : "#E75A25"}}
                onMouseOver={handleMouseOver}
                onMouseOut={handleMouseOut}
                onClick={console.log(props.location.state)}
            >Search
            </button>
        <div className="lookup-footer">
            <button
                className="back-button"
                onClick={() => history.push("/lookup")}>
                <ArrowBackIcon></ArrowBackIcon>
            </button>
            <Footer />
        </div>
    </div>
    )
}

export default Profile;
